import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import api from '../api';

const JobDetails = () => {
  const { jobId } = useParams();
  const [job, setJob] = useState({});
  const [isStaff, setIsStaff] = useState(false);
  const [applicantDetails, setApplicantDetails] = useState([]);
  const [applicantEmails, setApplicantEmails] = useState([]);

  useEffect(() => {
    getApplicantDetails();
  }, []);

  const getApplicantDetails = async () => {
    api
      .get("/applicant/applicant/list/")
      .then((res) => res.data)
      .then((data) => {
        setApplicantDetails(data);
        console.log(data);
      })
      .catch((err) => alert(err));
  };

  useEffect(() => {
    const retrievestaffstatus = async () => {
      const token = localStorage.getItem("access_token");
      if (token) {
        const response = await fetch("/applicant/retrieve-staff-status", {
          method: "GET",
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "application/json",
          },
        });

        if (response.ok) {
          const data = await response.json();
          setIsStaff(data.is_staff);
        }
      }
    }
    retrievestaffstatus();
  }, []);

  useEffect(() => {
    if (jobId) {
      getJob();
    }
  }, [jobId]);

  useEffect(() => {
    if (job.jobprimaryskill) {
      filterapplicants(job.jobprimaryskill);
    }
  }, [job.jobprimaryskill]);

  const getJob = () => {
    fetch(`/Jobs/List/${jobId}`)
      .then(response => response.json())
      .then(data => {
        setJob(data);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  const filterapplicants = (primarySkill) => {
    fetch('/applicant/skills/', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ skill: primarySkill }),
    })
      .then(response => {
        if (!response.ok) {
          return response.json().then(err => { throw err });
        }
        return response.json();
      })
      .then(data => {
        setApplicantEmails(data.emails);
      })
      .catch(error => {
        console.error('Error:', error);
        alert('Failed to fetch applicant emails. Please try again.');
      });
  };

  return (
    <div className="container">
      <div className="row">
        <div className="col-md-6">
          <div className="card">
            <div className="card-header">{job.jobtitle} - Job at {job.companyname}</div>
            <div className="card-body">
              <p className="card-text">
                Job Type: {job.jobtype}
              </p>
              <p className="card-text">
                Salary: £{job.salary}
              </p>
              <p className="card-text">
                Job Description: {job.jobdescription}
              </p>
              <p className="card-text">
                Location: {job.location}
              </p>
              <p className="card-text">
                Date listing was posted: {job.dateposted}
              </p>
              <p className="card-text">
                Deadline to apply: {job.deadline}
              </p>
              <p className="card-text">
                Sought skills: {job.jobprimaryskill}, {job.jobsecondaryskill}
              </p>
            </div>
          </div>
        </div>
        {isStaff && (
          <div className="col-md-6">
            <div className="card">
              <div className="card-header">Applicants with {job.jobprimaryskill} skill:</div>
              <div className="card-body">
                <ul>
                  {applicantEmails.map(email => (
                    <li key={email}>{email}</li>
                  ))}
                </ul>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default JobDetails;
